import React from "react";
import './TodoItem.scss'

function TodoItem({ status, name, date }) {
    return (
        <div className="todo--item">
            <ul>
                <li>{status?"true":"false"}</li>
                <li>{name}</li>
                <li>{date}</li>
            </ul>
        </div>
    );
}

export default TodoItem;
